import React from 'react';
import styles from '../css/QuickSearch.module.css'

const QuickSearch = ({title, link}) => {


    return (
        <a className="link" href={this.state.link} style={styles.link}>
            <div className="tag" style={styles.tag}>
                <p className="text" style={styles.text}>{this.state.title}</p>
            </div>
        </a>
    )
}

export default QuickSearch;
